(75408, 237398, 6813, 6, 'Rock ''N'' Roll Doctor', '與Led Zeppelin、Deep Purple被視為英籍重金屬樂三大先鋒團體原始專輯發表於1976年，拿下英國TOP13與一枚白 金唱片銷售認證，美國也突破五十萬門檻仍然秉持最拿手的Doom以及大玩黑暗的本領，慢板之作 “It’s Alright”讓叱吒80年代的搖滾大團槍與玫瑰著迷不已，更愛在演唱會中重新詮釋來自大英帝國，與Led Zeppelin、Deep Purple被視為重金屬樂三大先鋒團體的Black Sabbath，已成功入籍搖滾名人殿堂，滾石音樂雜誌選出「百大世紀偉大藝人」第85名，VH1頻道列為「百大優秀硬搖滾樂團」亞軍，僅次於齊柏林飛 船，讓後輩們無不臣服於他們實驗理念、不失藝術兼商業秉持搖滾熱血精神，是立下指標性的重要樂團。Ozzy Osbourne塑造出搖滾大魔頭形象，他極高亢的嗓音辨識度以及作風狂妄的舞台表演，都成為Black Sabbath鮮明的註冊商標。搖滾界的大哥大Ozzy，與幾位志同道合朋友組成Black Sabbath，高分貝的音量、充滿血腥與十足感官刺激的舞台表演，一再喚起金屬/搖滾迷們欲求解放的心。開創一頁頁傳奇新史，不時為金屬/搖滾樂注入全 新氣象，作風永遠大膽的魔頭，仍然屹立不搖成為重量級人物，受到後進新秀膜拜效法。這張原始發表於1976年的專輯【Technical Ecstasy】，拿下英國Top13外加一枚白金唱片銷售認證，美國也突破五十萬門檻。仍然秉持著Black Sabbath最拿手的Doom以及大玩黑暗的本領。火力全開的“Back Street Kids”，吉他猛飆以及不時衝出的Solo勾起亢奮情緒，再加上Ozzy一旁的搧風點火，呈現高漲的無比熱度，是支相當正點且稱頭 的開場；“You Won’t Change Me”則拱出耐聽的抒情金曲，透著率性依舊的霸氣，沒人能改變Ozzy的態度，永遠都沒人可以改變；二連發慢板之作&amp; ldquo;It’s Alright”，交付鼓手Bill Ward擔任主音演出，叱吒80年代的硬式搖滾大團槍與玫瑰更是愛在演唱會重新詮釋，並收在「Live Era: ’87-’93」現場收音特典裡頭；淒美動容小品“She’s Gone”，則套入弦樂的輔佐；最菁華的三強主打歌“Gypsy”、&amp; ldquo;Rock ’N’ Roll Doctor”、與長達七分鐘的“Dirty Women”，都是Black Sabbath讓你全身搖滾細胞復活的決定曲，不讓你爽到最後一秒，絕不罷休！', '2009-09-21 00:00:00', 2009, 19, 0, 7, '', '', 298, '', '', '', '', '', '', 0, 1, 0, '2014-05-06 15:33:29', '2015-03-12 14:06:51', '0000-00-00 00:00:00'),
